import React from 'react';
import MyPosts from './MyPosts/MyPosts';
import ProfileInfo from './ProfileInfo/ProfileInfo';



const Profile = (props) => {

    return <div>
        <ProfileInfo />
        <MyPosts posts={props.profilePage.posts} addPost={props.addPost} newPostText={props.profile}/>
    </div>
}

export default Profile;

